prediction.sparql:
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?title WHERE {
  ?pub a dblp:Publication ; dblp:title ?title
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?title ?authorName ?year WHERE {
  ?pub a dblp:Publication ; dblp:title ?title ; dblp:yearOfPublication ?year ; dblp:authoredBy ?author .
  ?author dblp:creatorName ?authorName .
  FILTER ( ?year <= 1940 )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?title ?year WHERE {
  ?pub dblp:publishedInStream <https://dblp.org/streams/journals/sigir> ; dblp:title ?title ; dblp:yearOfPublication ?year .
}

SELECT ?property ( COUNT( * ) AS ?count ) WHERE {
  ?s ?property ?o .
}
GROUP BY ?property
ORDER BY DESC ( ?count )

PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX datacite: <http://purl.org/spar/datacite/>
SELECT ?idType ( COUNT( * ) AS ?count ) WHERE {
  {
    ?pub a dblp:Publication .
    ?pub datacite:hasIdentifier ?idNode .
    ?idNode datacite:usesIdentifierScheme ?scheme .
    BIND( REPLACE( STR( ?scheme ) , "^.*:" , "" ) AS ?idType )
  } UNION {
    ?creator a dblp:Creator .
    ?creator dblp:orcid ?orcid .
    BIND( "ORCID" AS ?idType )
  } UNION {
    ?creator a dblp:Creator .
    ?creator owl:sameAs ?wikidata .
    FILTER ( STRSTARTS( STR( ?wikidata ) , "http://www.wikidata.org/entity/" ) ) BIND( "Wikidata" AS ?idType )
  }
}
GROUP BY ?idType
ORDER BY DESC ( ?count )
LIMIT 20

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?stream ?streamLabel ( COUNT( DISTINCT ?pub ) AS ?count ) WHERE {
  VALUES ?stream {
    <https://dblp.org/streams/conf/nips> <https://dblp.org/streams/conf/iclr> <https://dblp.org/streams/conf/icml> <https://dblp.org/streams/conf/cvpr> <https://dblp.org/streams/conf/acl> <https://dblp.org/streams/conf/aaai> <https://dblp.org/streams/conf/chi> <https://dblp.org/streams/conf/eccv> <https://dblp.org/streams/conf/emnlp> <https://dblp.org/streams/conf/siggraph>
  }
  ?pub a dblp:Publication ; dblp:publishedInStream ?stream .
  OPTIONAL {
    ?stream rdfs:label ?streamLabel
  }
}
GROUP BY ?stream ?streamLabel
ORDER BY DESC ( ?count )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?title ?year WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/k/DonaldEKnuth> .
  ?pub rdfs:label ?title .
  OPTIONAL {
    ?pub dblp:yearOfPublication ?year
  }
  .
  OPTIONAL {
    ?pub dblp:yearOfEvent ?year
  }
  .
}
ORDER BY DESC ( ?year )
